data:
  definition: ensemble composé d'un câble souple, équipé d'une fiche non démontable
    et d'un socle mobile non démontable complémentaires l'un de l'autre
  examples: []
  notes:
  - Le cordon est dit «cordon adaptateur» lorsque le socle et la fiche ne sont pas
    complémentaires.
